import styled from "styled-components";

const Historic = styled.div`
    width: 100%;
    height: 65vh;
    display: flex;
    background-color: #ffffff;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    border-radius: 5px;

`;

export default Historic;
